import './App.css';
import MapGl from 'react-map-gl'
import { useState } from 'react';

function App() {
  const [viewport, setViewport] = useState({
    latitude: 37.729,
    longitude: -122.36,
    zoom: 11,
    bearing: 0,
    pitch: 50
  })
  const [settings, setSettings] = useState({
    dragPan: true,
    dragRotate: true,
    scrollZoom: true,
    touchZoom: true,
    touchRotate: true,
    keyboard: true,
    doubleClickZoom: true,
    minZoom: 0,
    maxZoom: 20,
    minPitch: 0,
    maxPitch: 85
  });

  return (
    <>
      <MapGl
      {...viewport}
      {...settings}
      width='100%'
      height='100%'
      mapStyle="mapbox://styles/mapbox/dark-v9"
      mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}


      >

      </MapGl>
    </>
  );
}

export default App;
